import React from "react";
import { Grid } from "@material-ui/core";

function Add_Form() {
  return (
    <Grid>
      <form>
        <Grid component>
          IMAGE_SOURCE : <input type="text"></input>
        </Grid>

        <Grid component>
          NAME OF THE BOOK:<input type="text"></input>
        </Grid>

        <Grid component>
          AUTHOR:<input type="text"></input>
        </Grid>
        <Grid component>
          <input type="submit"></input>
        </Grid>
      </form>
    </Grid>
  );
}

export default Add_Form;
